class AllPlacesResponse {
  AllPlacesResponse({
      this.places,});

  AllPlacesResponse.fromJson(dynamic json) {
    if (json['places'] != null) {
      places = [];
      json['places'].forEach((v) {
        places?.add(Place.fromJson(v));
      });
    }
  }
  List<Place>? places;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    if (places != null) {
      map['places'] = places?.map((v) => v.toJson()).toList();
    }
    return map;
  }

}